/* Global Variables */
volatile int pixel_buffer_start;
short int title_background[240][320];

// Different display conditions
volatile bool title_page_display = true; // Game title page display condition
volatile bool loop_condition = true; // Main game display condition
volatile bool graph_display = false; // Kinetic energy graph display condition

/* Back-end parameter initializations */
double init_pos_x = RESOLUTION_X/2 - 32;
double init_pos_y = RESOLUTION_Y/2;
double init_vel_x = 0.0;
double init_vel_y = 12.0;

int main(void)
{
    /* Store raw game title pixel colours into 2D array named title_background*/
    display_image_from_array(title_image, title_background, 240, 320);
    
    /* Interrupt initializations */
    disable_A9_interrupts(); // disable interrupts in the A9 processor
    set_A9_IRQ_stack(); // initialize the stack pointer for IRQ mode
    config_GIC(); // configure the general interrupt controller
    config_KEYs(); // configure pushbutton KEYs to generate interrupts
    enable_A9_interrupts(); // enable interrupts in the A9 processor

    double central_mass = 100;

    /* VGA initializations */
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;

    /* Set up VGA DMA double buffering registers */
    // Set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // Store the address in the back buffer
    wait_for_vsync(); // Swap the front/back buffers, to set the front buffer location
    // Initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    draw_background(); // Pixel_buffer_start points to the pixel buffer
    // Set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // We draw on the back buffer
    draw_background(); // Pixel_buffer_start points to the pixel buffer

    /* Satellite variable declarations */
    vector launch_pos, launch_vel;
    initialize_vector(&launch_pos);
    launch_pos.x = init_pos_x;
    launch_pos.y = init_pos_y;

    initialize_vector(&launch_vel);
    launch_vel.x = init_vel_x;
    launch_vel.y = init_vel_y;

    vector cen_position_vec;
    initialize_vector(&cen_position_vec);
    cen_position_vec.x = RESOLUTION_X/2;
    cen_position_vec.y = RESOLUTION_Y/2;

    vector sat_position_vec;
    initialize_vector(&sat_position_vec);
    sat_position_vec = launch_pos;


    vector sat_velocity_vec;
    initialize_vector(&sat_velocity_vec);
    sat_velocity_vec = launch_vel;

    vector r;
    initialize_vector(&r);

    vector rhat;
    initialize_vector(&rhat);

    double rmag;

    vector Fgrav;
    initialize_vector(&Fgrav);

    
    vector sat1_prev, sat1_prev2;
    sat1_prev2 = sat1_prev = sat_position_vec;

    double satellite_mass = 10.0;

    double G = 46.08;

    double kinetic_energy_array[261];
    double kinetic_energy_array_prev[261];
    double kinetic_energy_array_prev2[261];

    for (int i = 0; i <= 258; i++){
        kinetic_energy_array[i] = 0;
        kinetic_energy_array_prev[i] = 0;
        kinetic_energy_array_prev2[i] = 0;
    }

    double dt = 0.25;
    double t = 0;

    int i = 0;

    double max_kinetic_energy = 1000;
    double scaling_factor = 1000;
    double scaling_factor_old = 1000;
    int condition = 0;

    int first_time = 1;
    int do_once;

    /* Display game title image at the beginning of the program */
    while (title_page_display == true){
        draw_title_text();  // write "ORBIT" at top of screen; write "PRESS KEY0 TO START" at bottom of screen
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }

    /* After KEY0 is pressed, clear the screen and enter into the main game */
    clear_screen();
    wait_for_vsync();
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    clear_screen();    

    /* Superloop | Main Game */
    while (loop_condition){
        do_once = 0;
        /* Display main game */
        if (graph_display == false){
            /* Draw central body */
            draw_body(cen_position_vec.x, cen_position_vec.y, 5, YELLOW);

            /* STEP 1: Erase any boxes and lines that were drawn in the previous previous iteration */
            clear_box(sat1_prev2.x, sat1_prev2.y);

            /* STEP 2: Draw current body */
            draw_body(sat_position_vec.x, sat_position_vec.y, SATELLITE_SIZE, WHITE);
        }

        /* STEP 3: Set previous previous location to previous */
        sat1_prev2 = sat1_prev;

        /* STEP 4: Set previous location to current */
        sat1_prev = sat_position_vec;

        /* Display Graph */
        if (graph_display == true){
            draw_graph_axis(); // Draw graph x and y axis
        }

        /* STEP 5: Increment current satellite locations */
        /* Get x and y radius */
        r.x = sat_position_vec.x - cen_position_vec.x;
        r.y = sat_position_vec.y - cen_position_vec.y;

        /* Get radius magnitude */
        rmag = mag_vector(r);
        /* Get x and y radius unit vector */
        rhat = unit_vector(r);
        
        /* Compute gravitational force */
        Fgrav.x = -1 * G * ((central_mass * satellite_mass) / (rmag * rmag)) * rhat.x;
        Fgrav.y = -1 * G * ((central_mass * satellite_mass) / (rmag * rmag)) * rhat.y;

        /* Compute x and y satellite velocity */
        sat_velocity_vec.x = sat_velocity_vec.x + (Fgrav.x / satellite_mass) * dt;
        sat_velocity_vec.y = sat_velocity_vec.y + (Fgrav.y / satellite_mass) * dt;

        /* Compute x and y satellite position */
        sat_position_vec.x = sat_position_vec.x + sat_velocity_vec.x * dt;
        sat_position_vec.y = sat_position_vec.y + sat_velocity_vec.y * dt;
        /* Check if satellites crash into the central body or if satellites go out of VGA borders (320 x 240)
           If they do, loop_condition is set to false, and wait for KEY0 to be pressed to reset the main game */
        check_cen_body_touch(sat_position_vec.x, sat_position_vec.y, cen_position_vec.x, cen_position_vec.y);
        printf("LOOP COND1 = %d\n", loop_condition);
        check_out_bounds(sat_position_vec.x, sat_position_vec.y);
        printf("LOOP COND2 = %d\n", loop_condition);
        /* Compute 258 iterations of the kinetic energy of satellite */
        if (i <= 258){
            /* Compute kinetic energy and store into an array named kinetic_energy_array */
            kinetic_energy_array[i] = 0.5 * satellite_mass * ((sat_position_vec.x * sat_position_vec.x) + (sat_position_vec.y * sat_position_vec.y));

            /* Find maximum kinetic energy in array */
            if (kinetic_energy_array[i] > max_kinetic_energy){
                max_kinetic_energy = kinetic_energy_array[i];
                condition = 1;
            }
            
            /* Increment kinetic energy array index */
            i = i + 1;
        }
        /* Increment time by dt */
        t = t + dt;

        /* Update graph with kinetic energy */
        if (graph_display == true){
            draw_kinetic_energy_graph(kinetic_energy_array, kinetic_energy_array_prev, &scaling_factor,
            &scaling_factor_old, &max_kinetic_energy, &first_time, &condition);
        }

        /* STEP 6: APPLY VSYNC to refresh the double buffers for the next frame */
        wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        /* If the satellites crash into the central body or go out of VGA bounds (320 x 240),
            re-initialize all variables once and wait for KEY0 to be pressed */
        while (loop_condition == false){
            /* Only re-initialize variables once */
            if (do_once == 0){
                launch_pos.x = init_pos_x;
                launch_pos.y = init_pos_y;

                initialize_vector(&launch_vel);
                launch_vel.x = init_vel_x;
                launch_vel.y = init_vel_y;

                initialize_vector(&sat_position_vec);
                sat_position_vec = launch_pos;


                initialize_vector(&sat_velocity_vec);
                sat_velocity_vec = launch_vel;

                initialize_vector(&r);

                initialize_vector(&rhat);

                initialize_vector(&Fgrav);

                t = 0;

                sat1_prev2 = sat1_prev = sat_position_vec;

                i = 0;
                max_kinetic_energy = 1000;
                scaling_factor = 1000;
                scaling_factor_old = 1000;
                condition = 0;

                first_time = 1;
                for (int i = 0; i <= 258; i++){
                    kinetic_energy_array[i] = 0;
                    kinetic_energy_array_prev[i] = 0;
                    kinetic_energy_array_prev2[i] = 0;
                }
                graph_display = false;

                do_once = 1;
            }
        }

    }

}

void draw_kinetic_energy_graph(double* kinetic_energy_array, double* kinetic_energy_array_prev, double* scaling_factor, 
                                double* scaling_factor_old, double* max_kinetic_energy, int* first_time, int* condition){

    /* Scale and shift vertical axis [kinetic energy] */
    for (int i_2 = 0; i_2 <= 258; i_2++){
        plot_pixel(i_2 + 41, round(-1 * (*(kinetic_energy_array_prev + i_2) / *scaling_factor_old) + 206), BLACK);
    }

    if (*condition == 1){

        if (*first_time){
            *scaling_factor_old = (*max_kinetic_energy + 30) / 170;
            *first_time = 0;
        }

        else {
            *scaling_factor_old = *scaling_factor;
        }

        *scaling_factor = (*max_kinetic_energy + 30) / 170;
        *condition = 0;
    }
    
    /* For each index of the kinetic energy array: */
    for (int idx = 0; idx <= 258; idx++){
        /* Apply scaling factor to each index of the kinetic energy array */
        plot_pixel(idx + 41, round(-1 * (*(kinetic_energy_array + idx) / *scaling_factor) + 206), GREEN);
        /* Clear the line right above the x-axis (unknown reason why there is a green line there) */
        plot_pixel(idx + 41, 206, BLACK);
        /* Set the current kinetic energy array to the previous kinetic energy array */
        *(kinetic_energy_array_prev + idx) = *(kinetic_energy_array + idx);
    }

    /* Write axis titles, "KINETIC ENERGY AND TIME PLOT" "KE" and "TIME" */
    draw_graph_axis_name();
}

void draw_graph_axis(){
    // Vertical axis [kinetic energy]
    draw_line(40, 30, 40, 207, WHITE);
    // Horizontal axis [time]
    draw_line(40, 207, 300, 207, WHITE);
}

void clear_graph(){
    for (int x = 41; x <= 300; x++){
        for (int y = 29; y <= 199; y++){
            plot_pixel(x, y, BLACK);
        }
    }
}

void draw_line(int x0, int y0, int x1, int y1, short int line_color){
    bool is_steep = ABS(y1 - y0) > ABS(x1 - x0);
    if (is_steep){
        swap(&x0, &y0);
        swap(&x1, &y1);
    }

    if (x0 > x1){
        swap(&x0, &x1);
        swap(&y0, &y1);
    }
    int deltax = x1 - x0;
    int deltay = ABS(y1 - y0);
    int error = -1*(deltax / 2);
    
    int y = y0;
    int y_step = 0;

    if (y0 < y1){
        y_step = 1;
    }
    else {
        y_step = -1;
    }

    for (int x = x0; x != x1; x++){
        if (is_steep){
            plot_pixel(y, x, line_color);
        }
        else {
            plot_pixel(x, y, line_color);
        }
        error += deltay;
        if (error > 0){
            y += y_step;
            error -= deltax;
        }
    }
}

void check_out_bounds(int x, int y){
    /* Satellite hit y (vertical) border */
    for (int i = x; i < x + 3; i++){
        if (i < 0 || i > RESOLUTION_X-1){
            loop_condition = false;
            return;
        }
    }
    
    /* Satellite hit x (horizontal) border */
    for (int i = y; i < y + 3; i++){
        if (i < 0 || i > RESOLUTION_Y-1){
            loop_condition = false;
            return;
        }
    }
}

void check_cen_body_touch(int x_body, int y_body, int x_cen_body, int y_cen_body){
    for (int x = x_cen_body; x < x_cen_body + 5; x++){
        for (int y = y_cen_body; y < y_cen_body + 5; y++){
            if (((x_body == x) && (y_body == y)) || ((x_body + 1 == x) && (y_body == y)) || ((x_body + 2 == x) && (y_body == y)) ||
                ((x_body == x) && (y_body + 1 == y)) || ((x_body + 1 == x) && (y_body + 1 == y)) || ((x_body + 2 == x) && (y_body + 1 == y)) ||
                ((x_body == x) && (y_body + 2 == y)) || ((x_body + 1 == x) && (y_body + 2 == y)) || ((x_body + 2 == x) && (y_body + 2 == y)))                
                loop_condition = false;
        }
    }
}

void draw_body(int x, int y, int size, short int color){
    for (int i = x; i < x + size; i++){
        for (int j = y; j < y + size; j++){
            plot_pixel(i, j, color);
        }
    }
}

void wait_for_vsync(){
    volatile int * pixel_ctrl_ptr = (int *) PIXEL_BUF_CTRL_BASE;
    volatile int status;
    *pixel_ctrl_ptr = 1;
    status = *(pixel_ctrl_ptr + 3);
    while ((status &0x01) != 0x0) {
        status = *(pixel_ctrl_ptr + 3);
    }
}

void plot_pixel(int x, int y, short int line_color){
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void clear_screen(){
    for (int x = 0; x < RESOLUTION_X; x++){
        for (int y = 0; y < RESOLUTION_Y; y++){
            plot_pixel(x, y, BLACK);
        }
    }
}

void swap(int* val1, int* val2){
    int val1_temp = *val1;
    *val1 = *val2;
    *val2 = val1_temp;
}

void clear_box(int x, int y){
    for (int i = x; i < x + 3; i++){
        for (int j = y; j < y + 3; j++){
            plot_pixel(i, j, BLACK);
        }
    }
}


/* Interrupt Subroutines */
/* Setup the KEY interrupts in the FPGA */
void config_KEYs() {
    volatile int * KEY_ptr = (int *) 0xFF200050; // pushbutton KEY base address
    *(KEY_ptr + 2) = 0xF; // enable interrupts for the two KEYs
}

void pushbutton_ISR(void);
void config_interrupt(int, int);

// Define the IRQ exception handler
void __attribute__((interrupt)) __cs3_isr_irq(void) {
    // Read the ICCIAR from the CPU Interface in the GIC
    int interrupt_ID = *((int *)0xFFFEC10C);
    if (interrupt_ID == 73) // check if interrupt is from the KEYs
        pushbutton_ISR();
    else
        while (1); // if unexpected, then stay here
        // Write to the End of Interrupt Register (ICCEOIR)
    *((int *)0xFFFEC110) = interrupt_ID;
}

/* Turn off interrupts in the ARM processor */
void disable_A9_interrupts(void) {
    int status = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

/* Initialize the banked stack pointer register for IRQ mode */
void set_A9_IRQ_stack(void) {
    int stack, mode;
    stack = 0xFFFFFFFF - 7; // top of A9 onchip memory, aligned to 8 bytes
    /* change processor to IRQ mode with interrupts disabled */
    mode = 0b11010010;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
    /* set banked stack pointer */
    asm("mov sp, %[ps]" : : [ps] "r"(stack));
    /* go back to SVC mode before executing subroutine return! */
    mode = 0b11010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}

/* Turn on interrupts in the ARM processor */
void enable_A9_interrupts(void) {
    int status = 0b01010011;
    asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

/* Configure the Generic Interrupt Controller (GIC) */
void config_GIC(void) {
    config_interrupt (73, 1); // configure the FPGA KEYs interrupt (73)

    // Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all
    // priorities
    *((int *) 0xFFFEC104) = 0xFFFF;

    // Set CPU Interface Control Register (ICCICR). Enable signaling of
    // interrupts
    *((int *) 0xFFFEC100) = 1;

    // Configure the Distributor Control Register (ICDDCR) to send pending
    // interrupts to CPUs
    *((int *) 0xFFFED000) = 1;
}

/*
* Configure Set Enable Registers (ICDISERn) and Interrupt Processor Target
* Registers (ICDIPTRn). The default (reset) values are used for other registers
* in the GIC.
*/
void config_interrupt(int N, int CPU_target) {
    int reg_offset, index, value, address;

    /* Configure the Interrupt Set-Enable
     Registers (ICDISERn).
    * reg_offset = (integer_div(N / 32) * 4
    * value = 1 << (N mod 32) */
    reg_offset = (N >> 3) & 0xFFFFFFFC;
    index = N & 0x1F;
    value = 0x1 << index;
    address = 0xFFFED100 + reg_offset;
    /* Now that we know the register address and value, set the appropriate bit */
    *(int *)address |= value;
    /* Configure the Interrupt Processor Targets Register (ICDIPTRn)
    * reg_offset = integer_div(N / 4) * 4
    * index = N mod 4 */
    reg_offset = (N & 0xFFFFFFFC);
    index = N & 0x3;
    address = 0xFFFED800 + reg_offset + index;
    /* Now that we know the register address and value, write to (only) the
    * appropriate byte */
    *(char *)address = (char)CPU_target;
}

/********************************************************************
* Pushbutton - Interrupt Service Routine
*
* This routine checks which KEY has been pressed
*******************************************************************/

void pushbutton_ISR(void) {
    /* KEY base address */
    volatile int * KEY_ptr = (int *) 0xFF200050;
    /* HEX display base address */
    volatile int * LEDR9_LEDR0_ptr = (int *) 0xFF200000;
    int press, HEX_bits;

    press = *(KEY_ptr + 3); // read the pushbutton interrupt register
    *(KEY_ptr + 3) = press; // Clear the interrupt

    /* KEY0 */
    if (press & 0x1){

        /* If main game is currently on display, change display to kinetic energy graph */
        if (loop_condition == true && title_page_display == false && graph_display == false){
            /* Set graph_display_condition to true so that the next time KEY0 is pressed, display is changed back to main game */
            graph_display = true;
            /* Clear the double buffers and clear the screen for graph display */
            volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
            clear_screen();
            wait_for_vsync();
            pixel_buffer_start = *(pixel_ctrl_ptr + 1);
            clear_screen();
            wait_for_vsync();
            pixel_buffer_start = *(pixel_ctrl_ptr + 1);
            clear_screen();

        }

        /* If kinetic energy graph is currently on display, change display to back to main game */
        else if (loop_condition == true && title_page_display == false && graph_display == true){
            /* Set graph_display_condition to true so that the next time KEY0 is pressed, display is changed back to kinetic energy graph */
            graph_display = false;
            /* Clear the double buffers and clear the screen for graph display */
            volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
            clear_screen();
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer 
            clear_screen();
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
            clear_screen();
        }
        
        /* If game title page is on display, pressing KEY0 would display main game */
        else if (loop_condition == true && title_page_display == true){
            /* Set title_page_display_condition to false */
            title_page_display = false;
        }

        /* If the satellite crashed into the central body or go out of VGA bounds (320 x 240), KEY0 would reset the game back to main game */
        else if (title_page_display == false && loop_condition == false){
            /* Set loop_condition to true */
            loop_condition = true;
            /* Clear the double buffers and clear the screen for main game display */
            volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
            clear_screen();
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer 
            clear_screen();
            wait_for_vsync(); // swap front and back buffers on VGA vertical sync
            pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
            clear_screen();
        }
    }

    /* KEY1 */
    else if (press & 0x2){
        /* If main game or kinetic energy graph is on display, KEY1 stops the main game
            Main game is reset when KEY0 is pressed */
        /* Set loop_condition to false */
        loop_condition = false;
    }

    /* KEY2 */
    else if (press & 0x4){ // KEY2
        HEX_bits = 0b01011011;
    }

    /* KEY 3 */    
    else // press & 0x8, which is KEY3
        HEX_bits = 0b01001111;

    *LEDR9_LEDR0_ptr = HEX_bits;
    return;
}


