void draw_ASCII_matrix(int x, int y, short int color, const uint32_t ASCII_matrix[8]) {
    for (int i = 0; i <= 7; i++) {
        for (int j = 0; j <= 7; j++) {
            if (ASCII_matrix[i] & (1 << (7 - j))) {
                plot_pixel(j + x, y + 2* i, color);
                
                plot_pixel(j + x, y + 2* i + 1, color);
            }
        }
    }
}

